      <div className="discover">
        <div className="Disontainer">
          <TopHeading title="Discover" />
        </div>
        <div className="content">
            {discover.map((val)=>{
return (
<div className='box'>
    <div className="img">
        <img src={val.cover} alt=""/>
    </div>
    <h1 className='title'>{val.title}</h1>
</div>)
            })}
        </div>
      </div>
    );
}

export default Discover
